import React, { useState, useEffect } from "react";
import { get } from "../Helpers";

export default function SearchResults(props) {
  const [profiles, setProfiles] = useState([]);

  useEffect(() => {
    get(
      "https://finnhub.io/api/v1/stock/symbol?exchange=US&token=bpleiinrh5r8m26im1dg"
    ).then((res) => {
      let r = new Map();
      for (let stock of res) {
        let symbol = stock["displaySymbol"];

        if (symbol.includes(props.searchText)) {
          r.set(
            symbol,
            get(
              "https://finnhub.io/api/v1/stock/profile2?symbol=AAPL&token=bpleiinrh5r8m26im1dg"
            )
          );
        }
      }

      Promise.all(r.values()).then((vals) => {
        setProfiles(vals);
      });
    });
  }, []);

  function results() {
    return profiles.map((val) => {
      return (
        <div>
          <a
            onClick={() => {
              props.setSelectedStock(symbol);
            }}
            style={{ fontSize: 25 }}
          >
            {symbol}
          </a>
        </div>
      );
      return <div>{val["name"]}</div>;
    });
  }

  console.log(profiles);

  return <div>{results()}</div>;
}
